import React from 'react';

const ZoomRegisteredModalBody = () => {
  return (
    <div>
      <h3>줌 미팅 등록 상태입니다</h3>
      <p>학생이 줌 미팅을 등록했어요. 확인해보세요.</p>
    </div>
  );
};

export default ZoomRegisteredModalBody;
